		<div id="mw-content-text" class="mw-body-content mw-content-ltr" lang="ja" dir="ltr"><div class="mw-parser-output"><p><b>宇奈月 満</b>（うなづきみつる、本名：福島正人、<a href="." id="link_1"                    >1968年</a><a href="." id="link_1"                            >7月22日</a> - ）は、主に<a href="." id="link_2"                                >秋田県</a>内で活動する<a href="." id="link_3"                                                                                  >ローカルタレント</a>である。<a href="." id="link_4"                                >東京都</a><a href="." id="link_5"                                >葛飾区</a>出身で、一部では<a href="." id="link_6"                                >栃木県</a><a href="." id="link_7"                                          >宇都宮市</a>出身ともいわれている。<a href="." id="link_8"                                                                                                                                                              >東洋プロダクション</a>所属。<a href="." id="link_9"                                                                                                                >ボーイズバラエティ協会</a>会員。
</p>
